    false,nt"url": null,nt"notes": "Marine mammal and other data were collected
    from the TURBO GOOSE from 30 July 1976 to 31 July 1976. Data were collected by the
    Alaska Department of Fish and Game as part of the Outer Continental Shelf Environmental
    Assessment Program (OCSEAP). Data were processed by NODC to the NODC standard F026
    Marine Mammal Sighting format. Full format description is available from the NODC
    homepage at www.nodc.noaa.gov/. An analog file for this accession is available from
    NODC user services.nnThe F026 format contains data from field observations of marine
    mammals. Obtained from ship or aircraft surveys, the data are collected to provide
    information on population density and distribution, migratory routes, and breeding
    locales. In addition to data on the survey track and observed environmental conditions
    (including ice conditions, if encountered), the file contains data for each species
    sighted. Parameters reported may include total number of individuals, number of
    pups, number of groups and number of mammals per group.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
